    function getDelegatedPower(uint256 cabalId, address delegatee) internal view returns (uint256) {
        bytes32 position = keccak256(abi.encodePacked(DELEGATED_POWER_POSITION, cabalId, delegatee));
        uint256 value;
        assembly {
            value := sload(position)
